import React from 'react';

function Product(props) {

    const name = props.match.params.name;

    return (
        <div className="">

            <h2>Товар № {props.match.params.id} наименование {props.match.params.name}</h2>;

            <div>
                <div>`{name}A - `</div>
                </div>

            </div>

        )
}

export default Product
